import React from "react";
import { RadioButtonWrapper, RadioIcon } from "./styles";

interface RadioButtonProps {
  label: string;
  isFilled: boolean;
}

const RadioButton: React.FC<RadioButtonProps> = ({ label, isFilled }) => {
  return (
    <RadioButtonWrapper>
      <RadioIcon isFilled={isFilled}>
        <circle />
      </RadioIcon>
      <span>{label}</span>
    </RadioButtonWrapper>
  );
};

export default RadioButton;
